import Holiday_Deals from '../holiday_deals';
import './App.css';
import Body from './body';
import Category from './category';
import Navbar from './navbar';

function App() {
  return (
    <>
    <div className='app'>

    <Navbar/>
    <Body/>
    <Category/>
    <Holiday_Deals/>
    </div>
    </>
  );
}

export default App;
